svg.script:
		

		// constants
		var STATES = ['AL','AK','AZ','AR','CA','CO','CT','DE','DC','FL','GA','HI','ID','IL','IN','IA','KS','KY','LA','ME','MD','MA','MI','MN','MS','MO','MT','NE','NV','NH','NJ','NM','NY','NC','ND','OH','OK','OR','PA','RI','SC','SD','TN','TX','UT','VT','VA','WA','WV','WI','WY'];
		var STATE_NAMES = ['Alabama','Alaska','Arizona','Arkansas','California','Colorado','Connecticut','Delaware','District of Colombia','Florida','Georgia','Hawaii','Idaho','Illinois','Indiana','Iowa','Kansas','Kentucky','Louisiana','Maine','Maryland','Massachusetts','Michigan','Minnesota','Mississippi','Missouri','Montana','Nebraska','Nevada','New Hampshire','New Jersey','New Mexico','New York','North Carolina','North Dakota','Ohio','Oklahoma','Oregon','Pennsylvania','Rhode Island','South Carolina','South Dakota','Tennessee','Texas','Utah','Vermont','Virginia','Washington','West Virginia','Wisconsin','Wyoming'];
		// data from: http://www.census.gov/popest/data/state/totals/2014/index.html
		var DEFAULT_DATA = [['AL', 'https://www.billtrack50.com/BillDetail/799672'],['AK', 'https://www.billtrack50.com/BillDetail/858894'],['AZ', 'https://www.billtrack50.com/BillDetail/782423'],['AR', 'https://www.billtrack50.com/BillDetail/755370'],['CA', 'https://www.billtrack50.com/BillDetail/525746'],['CO', 'https://www.billtrack50.com/BillDetail/857561'],['CT', 'https://www.billtrack50.com/BillDetail/948001'],['DE', 'https://www.billtrack50.com/BillDetail/889981'],['DC', 'https://www.billtrack50.com/BillDetail/882658'],['FL', 'https://www.billtrack50.com/BillDetail/959532'],['GA', 'https://www.billtrack50.com/BillDetail/860173'],['HI', 'https://www.billtrack50.com/BillDetail/930838'],['ID', 'https://www.billtrack50.com/BillDetail/950389'],['IL', 'https://www.billtrack50.com/BillDetail/892831'],['IN', 'https://www.billtrack50.com/BillDetail/765147'],['IA', 'https://www.billtrack50.com/BillDetail/958322'],['KS', 'https://www.billtrack50.com/BillDetail/925043'],['KY', 'https://www.billtrack50.com/BillDetail/918704'],['LA', 'https://www.billtrack50.com/BillDetail/961024'],['ME', 'https://www.billtrack50.com/BillDetail/584273'],['MD', 'https://www.billtrack50.com/BillDetail/947429'],['MA', 'https://www.billtrack50.com/BillDetail/839438'],['MI', 'https://www.billtrack50.com/BillDetail/881855'],['MN', 'https://www.billtrack50.com/BillDetail/960010'],['MS', 'https://www.billtrack50.com/BillDetail/924246'],['MO', 'https://www.billtrack50.com/BillDetail/898999'],['MT', 'https://www.billtrack50.com/BillDetail/763295'],['NE', 'https://www.billtrack50.com/BillDetail/683553'],['NV', 'https://www.billtrack50.com/BillDetail/864306'],['NH', 'https://www.billtrack50.com/BillDetail/802162'],['NJ', 'https://www.billtrack50.com/BillDetail/975947'],['NM', 'https://www.billtrack50.com/BillDetail/935229'],['NY', 'https://www.billtrack50.com/BillDetail/944390'],['NC', 'https://www.billtrack50.com/BillDetail/856856'],['ND', 'https://www.billtrack50.com/BillDetail/548775'],['OH', 'https://www.billtrack50.com/BillDetail/982633'],['OK', 'https://www.billtrack50.com/BillDetail/776657'],['OR', 'https://www.billtrack50.com/BillDetail/770100'],['PA', 'https://www.billtrack50.com/BillDetail/955901'],['RI', 'https://www.billtrack50.com/BillDetail/862238'],['SC', 'https://www.billtrack50.com/BillDetail/833654'],['SD', 'https://www.billtrack50.com/BillDetail/936241'],['TN', 'https://www.billtrack50.com/BillDetail/940920'],['TX', 'https://www.billtrack50.com/BillDetail/753531'],['UT', 'https://www.billtrack50.com/BillDetail/684236'],['VT', 'https://www.billtrack50.com/BillDetail/934009'],['VA', 'https://www.billtrack50.com/BillDetail/897074'],['WA', ''],['WV', ''],['WI', ''],['WY', '']];
		var DEFAULT_COLORS = ['#d42729','#0157ae','#000654','#b01111','#7a0000']; //['#cf9f1f', '#1f9f1f', '#1f1fcf', '#9f1f9f', '#cf1f1f'];
		var DEFAULT_COLOR = "#cdcdcd";
		var STYLE_MAPPINGS = { backgroundColor: "fill", borderColor: "stroke", borderWidth: "stroke-width", color: "fill", fontFamily: "font-family", fontSize: "font-size", fontWeight: "font-weight", fontStyle: "font-style", stroke: "stroke", strokeWidth: "stroke-width", strokeDashArray: "stroke-dasharray", textDecoration: "text-decoration" };
		var WIDTH = 540;
		var HEIGHT = 380;

		// param variables
		var _data = [];
		var _valueLabel = "";
		var _valueFormat = null;
		var _colors = DEFAULT_COLORS;
		var _colorBoundaries = null;
		var _backgroundColor = "transparent";
		var _defaultColor = DEFAULT_COLOR;
		var _labelStyle = null; //{ fontFamily: "Trebuchet MS" };
		var _popupStyle = null; //{ fontFamily: "Trebuchet MS", backgroundColor: "#7fff7f", color: "red", fontSize: "20px" };
		var _labelType = 'code';
		var _showLabels = true;
		var _showPopup = true;
		var _showAnimation = true;

		// general variables
		var _loaded = false;
		var _runAnimation = true;
		var _activeState = null;
		var _labelStylesToRemove = null;
		var _popupStylesToRemove = null;
		var _stateOutTimeoutToken = null;
		var _popupSnapEle = null;
		var _currentPopupWidth = 0; //todo calc
		var _currentPopupHeight = 0; //todo calc


		/* Loading */

		// entry point
		function init() {
			//debugger;
			console.log('init');
			// init stuff
			initDemo();
			initParams();
			initEvents();
			initPopup();

			drawIfStandalone();
			_loaded = true;
		}

		function initDemo() {
			// for demo purposes only, in case no data is passed
			_data = DEFAULT_DATA;
			_valueLabel = "State Bill Link";
		}

		function initParams() {
			loadParams();
		}

		function initEvents() {
			var surface = Snap(document.documentElement);
			surface.mouseover(handleSurfaceClick);
			surface.click(handleSurfaceClick);
			svidget.$.onpagepopulate(handlePagePopulate);
			var stateGroups = Snap("#states").selectAll("g");
			// wire events
			iterateStates(function (snapEle) {
				snapEle.mouseover(handleStateOver);
				snapEle.touchstart(handleStateOver); // for touch devices
				snapEle.mouseout(handleStateOut);
				snapEle.click(handleStateClick);
			});
		}

		function initPopup() {
			//var popup = Snap("#popupbox");
			//var rect = popup.select("rect");
			_currentPopupWidth = 120;
			_currentPopupHeight = 50;
		}

		function drawIfStandalone() {
			// this is temp hack to give chance for page to pass params, if no page then we are in standalone mode
			window.setTimeout(function () {
				if (svidget.$.populatedFromPage()) return;
				draw();
			}, 100);
		}

		window.addEventListener('load', init, false);


		/* Param Loading */

		function loadParams() {
			//debugger;
			var widget = svidget.$;
			_data = checkNull(widget.param("data").value(), _data);
			loadStatesParams(widget);
			loadLabelParams(widget);
			loadPopupParams(widget);
		}

		function loadStatesParams(widget) {
			_colors = checkNull(widget.param("colors").value(), _colors);
			_colorBoundaries = checkNull(widget.param("colorBoundaries").value(), _colorBoundaries);
			_backgroundColor = checkNull(widget.param("backgroundColor").value(), _backgroundColor);
			_defaultColor = checkNull(widget.param("defaultColor").value(), _defaultColor);
		}

		function loadLabelParams(widget) {
			_labelStyle = checkNull(widget.param("labelStyle").value(), _labelStyle);
			_labelType = checkNull(widget.param("labelType").value(), _labelType);
			_showLabels = checkNull(widget.param("showLabels").value(), _showLabels);
			_showAnimation = checkNull(widget.param("showAnimation").value(), _showAnimation);
		}

		function loadPopupParams(widget) {
			_valueLabel = checkNull(widget.param("valueLabel").value(), _valueLabel);
			//_valueFormat = checkNull(widget.param("valueFormat").value(), _valueFormat);
			_popupStyle = checkNull(widget.param("popupStyle").value(), _popupStyle);
			_showPopup = checkNull(widget.param("showPopup").value(), _showPopup);
		}


		/* Param Events */

		// this handler is invoked once the params from page are passed to widget and populated onto params
		function handlePagePopulate(e) {
			loadParams();
			draw();
		}

		// this handler is invoked when the data params is set
		function handleDataParamSet(e) {
			var widget = svidget.$;
			if (!widget.connected() || !widget.populatedFromPage()) return; // not all params have been populated, so defer until loadParams() is called
			_runAnimation = _runAnimation || e.target.name() == "data";
			loadParams();
			draw();
		}

		// this handler is invoked when these params are set: colors, colorBoundaries, defaultColor
		function handleStatesParamSet(e) {
			var widget = svidget.$;
			if (!widget.connected() || !widget.populatedFromPage()) return; // not all params have been populated, so defer until loadParams() is called
			loadStatesParams(widget);
			drawStates();
		}

		// this handler is invoked when these params are set: labelStyle, showLabels
		function handleLabelParamSet(e) {
			var widget = svidget.$;
			if (!widget.connected() || !widget.populatedFromPage()) return; // not all params have been populated, so defer until loadParams() is called
			loadLabelParams(widget);
			drawLabels();
		}

		// this handler is invoked when these params are set: labelStyle, showLabels
		function handlePopupParamSet(e) {
			var widget = svidget.$;
			if (!widget.connected() || !widget.populatedFromPage()) return; // not all params have been populated, so defer until loadParams() is called
			loadPopupParams(widget);
			drawPopup();
		}


		/* Action Events */

		function runAnimation() {
			//debugger;
			var statesEle = Snap("#states");
			setVisibility(statesEle, true);
			var counter = 0;
			iterateStates(function (snapEle) {
				setVisibility(snapEle, false);
				setTimeout(function () { setVisibility(snapEle, true) }, counter);
				counter += 10;
			});
		}

		// bound to animate action
		function animate(e) {
			runAnimation();
		}


		/* UI Events */

		function handleStateOver(e) {
			//if (e.currentTarget.tagName != "g") return;
			if (_stateOutTimeoutToken != null) clearTimeout(_stateOutTimeoutToken);
			_stateOutTimeoutToken = null;
			iterateStates(function (snapEle) {
				snapEle.removeClass("hover");
				snapEle.addClass("nonhover");
			});
			var target = Snap(e.currentTarget);
			target.removeClass("nonhover");
			target.addClass("hover");
			var state = getStateFromGroupID(e.currentTarget.id);
			//debugger;
			if (_showPopup) showPopup(state);
			if (_activeState != state) e.preventDefault(); // in case of touchstart, prevents "click" from firing (needs test)
			_activeState = state;
			svidget.$.event("stateSelect").trigger(toEventValue(state));
			//console.log('handleStateOver state=' + state);
		}

		function handleStateOut(e) {
			//debugger;
			if (e != null) return; // && e.target.tagName != "g" && e.target.parentNode == e.fromElement.parentNode) return;
			iterateStates(function (snapEle) {
				snapEle.removeClass("hover");
				snapEle.removeClass("nonhover");
			});

			hidePopup();
			var state = _activeState;
			_activeState = null;
			svidget.$.event("stateUnselect").trigger(toEventValue(state));
		}

		function handleStateClick(e) {
			//alert('clicked');
			var target = Snap(e.currentTarget);
			var state = getStateFromGroupID(e.currentTarget.id);
			svidget.$.event("stateActivate").trigger(toEventValue(state));
			e.stopPropagation();
		}

		function handleSurfaceClick(e) {
			if (e.target.tagName != "svg" && e.target.tagName != "rect") return;
			console.log("handleSurfaceClick: " + e.target.tagName);
			// this prevents the flicker that occurs intermittently when the mouse crosses between states
			_stateOutTimeoutToken = setTimeout(function () { handleStateOut(null); }, 50);
			//handleStateOut(null);
		}

		function toEventValue(state) {
			return { name: state, value: 0 }; // todo: value
		}


		/* Popup */

		function showPopup(state) {
			// populate popup fields
			populatePopup(state);
			// resize so everything fits
			resizePopup();
			// determine bounding box of state - cache
			// place popup 20 pixels from topleft corner or bottomleft, topright, bottomright (inside of right)
			positionPopup(state);
			setPopupVisible(true);
		}

		function hidePopup() {
			setPopupVisible(false);
		}

		function setPopupVisible(visible) {
			var d = visible ? "" : "none";
			document.getElementById("popupbox").setAttribute("display", d);
		}

		function populatePopup(state) {
			var stateItem = findStateItem(state);
			document.getElementById("popupboxtitle").textContent = getStateName(state);
			document.getElementById("popupvaluelabel").textContent = stateItem[1];
		}

		function resizePopup() {
			var popup = Snap("#popupbox");
			var popupRect = popup.select("rect");
			popupRect.attr({ width: 10, height: 10 });
			// note: IE has a bug where sometimes you get 0,0,0,0 for a bbox for a <g> element, so just reuse last w/h
			var bb = popup.getBBox();
			_currentPopupWidth = Math.max(bb.width + 5, _currentPopupWidth);
			_currentPopupHeight = Math.max(bb.height + 5, _currentPopupHeight);
			popupRect.attr({ width: _currentPopupWidth, height: _currentPopupHeight });
		}

		function positionPopup(state) {
			// debugger;
			// determine bounding box of state - cache
			var popup = Snap("#popupbox");
			var popupRect = popup.select("rect");
			var stateEle = Snap("#g" + state);
			var bbState = stateEle.getBBox();
			var bbPopup = popupRect.getBBox();
			if (bbPopup.width == 0 && bbPopup.height == 0) {
				// bug in IE, so just put popup in top/left corner
				popup.transform(translate(0, 0));
				return;
			}
			// place popup 20 pixels from topleft corner or bottomleft, topright, bottomright (inside of right)
			// var topClearance = bbState.y - bbPopup.height - 20;
			// var leftClearance = bbState.x - bbPopup.width - 20;
			var isTop = bbState.y > (bbPopup.height + 20); // topClearance > (HEIGHT / 2);
			var isLeft = (bbState.x + bbPopup.width + 20) > WIDTH; //  leftClearance > (WIDTH / 2);
			var popupX = isLeft ? WIDTH - bbPopup.width - 20 : bbState.x;
			var popupY = isTop ? bbState.y - bbPopup.height - 20 : bbState.y + bbState.height + 20;

			popup.transform(translate(popupX, popupY));

			function translate(x, y) {
				return "translate(" + x + " " + y + ")";
			}
		}


		/* Drawing */

		function draw() {
			var states = Snap("#states");
			setVisibility(states, false);
			drawStates(states);
			drawLabels(states);
			drawPopup(states);
			if (_showAnimation)
				runAnimation();
			else
				setVisibility(states, true);
		}

		function drawStates(statesEle) {
			//debugger;
			//var colors = _colors != null && _colors.length > 0 ? _colors || [_defaultColor];
			statesEle = statesEle || Snap("#states");
			var colorBoundaries = buildColorBoundaries();
			for (var i=0; i<STATES.length; i++) {
				var state = STATES[i]; // i.e. 'AZ'
				var stateItem = findStateItem(state);
				var color = stateItem == null ? _defaultColor : calcColor(colorBoundaries, stateItem[1]);
				colorState(state, color);
			}
			Snap("#backrect").attr({ fill: _backgroundColor });
		}

		function drawLabels(statesEle) {
			debugger;
			statesEle = statesEle || Snap("#states");
			if (_labelStyle == null && _labelStylesToRemove == null) return;
			// disallow certain attributes from styles: transform
			var styleObj = toSnapStyleObject(_labelStyle || {});
			_labelStylesToRemove = _labelStylesToRemove || {};
			populateStylesRemove(styleObj, _labelStylesToRemove);

			var textEles = statesEle.selectAll("g text");
			if (!_showLabels) {
				setVisibility(textEles, false); //.attr({ display: "none" });
			}
			else {
				setVisibility(textEles, true);
				textEles.attr(_labelStylesToRemove);
				textEles.attr(styleObj);
			}

			drawLabelText();
		}

		function drawLabelText() {
			var sum = 0;
			if (_labelType == 'percentage') sum = getStateValueSum();
			for (var i=0; i<STATES.length; i++) {
				var state = STATES[i]; // i.e. 'AZ'
				var stateItem = findStateItem(state);
				var val = stateItem == null ? 0 : stateItem[1];
				var label = getStateLabel(state, val);
				var textEle = Snap("#g" + state + " text");
				textEle.node.textContent = label;
			}

			function getStateLabel(state, val) {
				if (_labelType == 'percentage') {
					return toPctString(val / sum);
				}
				else if (_labelType == 'value') {
					return val;
				}
				else
					return state;
			}

			function toPctString(ratio) {
				return (Math.round(ratio * 1000) / 10.0) + "%";
			}
		}

		function getStateValueSum() {
			if (_data == null) return 0;
			var sum = 0;
			for (var i=0; i<_data.length; i++) {
				sum += _data[i][1];
			}
			return sum;
		}

		function drawPopup(statesEle) {
			//debugger;
			var popupEle = Snap("#popupbox");

			// update label
			var label = (_valueLabel) ? _valueLabel + ":" : "";
			document.getElementById("popupcatlabel").textContent = label;

			if (_popupStyle == null && _popupStylesToRemove == null) return;
			var iterObj = _popupStyle || {};
			_popupStylesToRemove = _popupStylesToRemove || {};

			// segment for rect vs group vs text objs
			// { backgroundColor: "fill", borderColor: "stroke", borderWidth: "stroke-width", color: "fill", fontFamily: "font-family", fontSize: "font-size", fontWeight: "font-weight", fontStyle: "font-style", stroke: "stroke", strokeWidth: "stroke-width", strokeDashArray: "stroke-dasharray", textDecoration: "text-decoration" };
			var rectObj = {};
			var groupObj = {};
			for (var key in iterObj) {
				if (key.indexOf("background") == 0 || key.indexOf("border") == 0)
					rectObj[key] = iterObj[key];
				else //if (key != "color")
					groupObj[key] = iterObj[key];
			}

			// populate elements with style objects
			populatePopupGroupEle(groupObj, popupEle);
			populatePopupRect(rectObj, popupEle);
		}

		function populatePopupGroupEle(groupObj, popupEle) {
			/*if (groupObj.color) {
				var popupTextEles = popupEle.selectAll("text");
				popupTextEles.attr({ fill: groupObj.color });
				iterateSnapElements(popupTextEles, function (ele) {
					ele.attr({ fill: groupObj.color });
				});
				delete groupObj.color;
			}*/
			var groupStyleObj = toSnapStyleObject(groupObj);
			var styleStr = toStyleString(groupStyleObj);
			var popupTextEles = popupEle.selectAll("text");
			popupTextEles.attr({ style: styleStr });
			//populateStylesRemove(groupStyleObj, _popupStylesToRemove);
			//popupEle.attr({ style: styleStr });
			//popupEle.attr(_popupStylesToRemove);
			//popupEle.attr(groupStyleObj);
		}

		function populatePopupRect(rectObj, popupEle) {
			var rectStyleObj = toSnapStyleObject(rectObj);
			//populateStylesRemove(rectStyleObj, _popupStylesToRemove);
			populateMissingStyles(rectStyleObj, { fill: "#fff" });
			var styleStr = toStyleString(rectStyleObj);
			var popupRectEle = popupEle.select("rect");
			popupRectEle.attr({ style: styleStr });
			// resize back to default, will expand later
			_currentPopupWidth = 120;
			_currentPopupHeight = 50;
			popupRectEle.attr({ width: _currentPopupWidth, height: _currentPopupHeight });
			//popupRectEle.attr(_popupStylesToRemove);
			//popupRectEle.attr(rectStyleObj);
		}


		/* Drawing Helpers */

		function colorState(state, color) {
			var stateSel = "#g" + state + " path";
			var statePath = Snap(stateSel);
			statePath.attr({
				fill: color
			});
		}

		function iterateStates(action) {
			var states = Snap("#states");
			var groups = states.selectAll("g");
			iterateSnapElements(groups, action);
		}

		function iterateSnapElements(elements, action) {
			for (var i=0; i<elements.length; i++) action(elements[i]);
		}

		function buildColorBoundaries() {
			if (_colors == null || _colors.length <= 1) return null;
			if (_colorBoundaries != null && _colorBoundaries.length > 0) {
				sortArray(_colorBoundaries);
				return _colorBoundaries;
			}
			return buildDefaultColorBoundaries();
		}

		function buildDefaultColorBoundaries() {
			if (_data.length == 0) return null;
			var boundaries = [];
			// length of valueArray can be 0-51
			var valueArray = extractsValuesFromData();
			sortArray(valueArray);
			var elecount = Math.min(_colors.length, _data.length);
			if (elecount <= 0) return null; // note: this should never happen, but let's be defensive
			var size = _data.length / elecount;
			for (var i=1; i<elecount; i++) {
				var index = Math.round(size * i) - 1;
				boundaries.push(valueArray[index]);
			}
			//for (var i=1; i<_colors.length; i++) boundaries.push(i / _colors.length);
			return boundaries;
		}

		function findStateItem(state) {
			for (var i=0; i<_data.length; i++) {
				var item = _data[i];
				if (item == null) continue;
				if (item[0] == state) return item;
			}
			return null;
		}

		function calcColor(colorBoundaries, value) {
			if (_colors == null || _colors.length == 0) return _defaultColor;
			if (colorBoundaries == null) return _colors[0]; // using only the first color
			var index = getIndexOfBoundary(colorBoundaries, value);
			if (index < 0) return _defaultColor;
			var ci = index % _colors.length; // there may be more boundaries than colors, so mod index
			return _colors[ci];
		}

		function getIndexOfBoundary(colorBoundaries, value) {
			// note: colorBoundaries already sorted from least to greatest
			for (var i=0; i<colorBoundaries.length; i++) {
				var cur = parseFloat(colorBoundaries[i]);
				if (value <= cur) return i;
			}
			return colorBoundaries.length;
		}

		function extractsValuesFromData() {
			var values = [];
			for (var i=0; i<_data.length; i++) {
				values.push(parseFloat(_data[i][1]));
			}
			return values;
		}

		function setVisibility(snapEle, visible) {
			var d = visible ? "block" : "none";
			snapEle.attr({ display: d });
		}

		function populateStylesRemove(styles, removeObj) {
			for (var key in styles) {
				removeObj[key] = null;
			}
		}

		function populateMissingStyles(styles, defObj) {
			for (var key in defObj) {
				if (styles[key] == null) styles[key] = defObj[key];
			}
		}

		function toSnapStyleObject(styleObj) {
			var snapObj = {};
			for (var key in styleObj) {
				var snapKey = STYLE_MAPPINGS[key];
				if (snapKey !== undefined) {
					snapObj[snapKey] = styleObj[key];
				}
			}
			return snapObj;
		}

		function toStyleString(styleObj) {
			var styleStr = "";
			for (var key in styleObj) {
				var item = key + ":" + styleObj[key] + ";";
				styleStr += item;
			}
			return styleStr;
		}

		/* Misc */

		function sortArray(arr, desc) {
			if (arr == null) return;
			var mul = desc ? -1 : 1;
